import React from "react"
import { MapContainer as LeafletMap, TileLayer, Circle, Popup} from "react-leaflet"
import {showDataOnMap} from "./util.js"
import ChangeView from "./ChangeView.js"
import "./Map.css"

function Map(props) {

  return (
    <div className="map">
      <LeafletMap center={props.center} zoom={props.zoom}>
        <ChangeView center={props.center} zoom={props.zoom} />
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        />
        {props.countries?.map(country => (
          <Circle center={[country.countryInfo.lat, country.countryInfo.long]} color="#CC1034" radius={Math.sqrt(country.cases) * 300}

          />
        ))}
      </LeafletMap>
    </div>
  )
}

export default Map
